    "2015-09-26T23:05:47.371319",nt"name": "specmap-archive-no-1-climate-times-series-downcore-and-core-top-data",nt"isopen":
    false,nt"url": null,nt"notes": "The SPECMAP Archive No.1 was compiled by
    Brown University under the direction of A. Duffy and J. Imbrie with the assistance
    of A.C. Mix and A. Mcintyre, and funded by the National Science Foundation. The
    SPECMAP Archive No.1 contains climate times series of the past 400,000 years, and
    basic downcore and core-top data from which these time series were derived for 17
    sediment cores from the Atlantic Ocean. Downcore records include (1) quantitative
    data on planktonic species and assemblages which reflect conditions in the surface
    waters of the Atlantic ocean; (2) measurements of 0-18, C-13 difference (planktic
    and benthic), and Cd/Ca. The age model used to transform each downcore record into
    a time series by correlation of its O-18 record with the published O-18 chronology
    of Imbrie et al. (1984) is given. Time series with uniformly spaced samples may
    be calculated by linear interpolation. The Archive No. 1 contains 101 files, including
    documentation and bibliographic information. The SPECMAR Archive No. 1 is available
    for direct ftp download from NCDC. The SPECMAP Archive No. 1 was originally submitted
    to NOAA's National Geophysical Data Center (NGDC) for archive and was subsequently
    transferred to NOAA's National Climatic Data Center (NCDC) Paleoclimatology Group
    for stewardship..",nt"license_title": null,nt"extras": [{ntt"key":
